import React from 'react';
import { useSelector } from 'react-redux';

const Home = () => {
  const username = useSelector(state => state.username);
  const text = username ? (
    <h1>{username} is currently logged in</h1>
  ) : (
    <h1>Nobody is logged in</h1>
  );
  return <div className = "container">{text}
   <h1>Increment/Decrement counter</h1>
   <h4>using react and redux</h4>
   <div className="quantity">
     <a className="quantity_minus" title="Decrement"><span> - </span></a>
     <input name="quantity" type="text" className="quantity_input" value ="0" />
     <a className="quantity_plus" title="Increment"><span> + </span></a>   </div>
  </div>;
};

export default Home;
